INSERT INTO `dt14330_comments` (`comment_ID`, `comment_post_ID`, `comment_author`, `comment_author_email`, `comment_author_url`, `comment_author_IP`, `comment_date`, `comment_date_gmt`, `comment_content`, `comment_karma`, `comment_approved`, `comment_agent`, `comment_type`, `comment_parent`, `user_id`) VALUES
  (10002, 10037, 'Mary Smith', 'marketer1@disicple.tools', '', '162.243.29.229', '2018-05-29 13:35:45', '2018-05-29 13:35:45', 'Zeyn filled out the webform and clicked \"I want to know more about Jesus\".', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
  (10003, 10036, 'David Smith', 'marketer2@disciple.tools', '', '162.243.29.229', '2018-05-29 13:38:02', '2018-05-29 13:38:02', 'This is my neighbor from Morocco, living in Madrid currently. I am adding him to Disciple.Tools because I gave him a Bible last week and He has been reading it. We read Matthew 5-7 together, and he was excited to read more on his own.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10004, 10038, 'Mary Smith', 'marketer1@disicple.tools', '', '162.243.29.229', '2018-05-29 13:39:12', '2018-05-29 13:39:12', 'This contact selected \"I want to become a Christian, but there are obstacles\" on the webform.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
  (10005, 10039, 'Mary Smith', 'marketer1@disicple.tools', '', '162.243.29.229', '2018-05-29 13:41:04', '2018-05-29 13:41:04', 'This contact selected \"I feel in my heart that I\'m ready to become a Christian\" on the webform.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
  (10006, 10040, 'Mary Smith', 'marketer1@disicple.tools', '', '162.243.29.229', '2018-05-29 13:42:37', '2018-05-29 13:42:37', 'This contact selected \"I want to know more about Jesus and the Bible\" on the webform.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
  (10007, 10041, 'David Smith', 'marketer2@disciple.tools', '', '162.243.29.229', '2018-05-29 13:44:13', '2018-05-29 13:44:13', 'He private messaged us on FB. He came with the usual questions/arguments, \"God can\'t have a son,\" \"what is the trinity?\" \"the Bible has been corrupted.\" However, he has been responding with great follow up questions to the articles I sent him on these topics. He is very open to expanding his knowledge base. He is asking to get a Bible of his own and wants to meet a Christian in person. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10008, 10042, 'Mary Smith', 'marketer1@disicple.tools', '', '162.243.29.229', '2018-05-29 13:44:45', '2018-05-29 13:44:45', 'This contact selected \"I want to know more about Jesus and the Bible\" on the webform.', 0, 'post-trashed', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
  (10009, 10043, 'Mary Smith', 'marketer1@disicple.tools', '', '162.243.29.229', '2018-05-29 13:46:49', '2018-05-29 13:46:49', 'This contact selected \"No, I\'m not interested right now\" on the webform.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
  (10010, 10045, 'Mary Smith', 'marketer1@disicple.tools', '', '162.243.29.229', '2018-05-29 13:52:55', '2018-05-29 13:52:55', 'Saira has been following our page for a while, though she has not made any comments, only likes. She finally messaged me today and asked me to send her a Bible.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
  (10011, 10046, 'David Smith', 'marketer2@disciple.tools', '', '162.243.29.229', '2018-05-29 13:55:47', '2018-05-29 13:55:47', 'Yamina contacted our Facebook page after having a dream about Jesus. In the dream, the person she believe was Jesus told her to read \"Ya, Yamina, read my Words. Don\'t be afraid.\" Then after he disappeared, there was a table before her filled with loaves and loaves of bread, and she heard His voice say, \"Eat and you will live.\" She has been going to the university in Madrid and has had some positive interactions with people who go to church. She isn\'t sure what the difference is between Catholicism and Protestantism but she is anxious to meet with someone who can give her Jesus\' Words in her language. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10012, 10047, 'Mary Smith', 'marketer1@disicple.tools', '', '162.243.29.229', '2018-05-29 13:55:51', '2018-05-29 13:55:51', 'Tarik has commented several times on our page, asking questions. He seems to desire to know more, though does not know much about the Bible yet. He sent a private message asking to talk with someone to learn more.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
  (10013, 10048, 'David Smith', 'marketer2@disciple.tools', '', '162.243.29.229', '2018-05-29 14:03:24', '2018-05-29 14:03:24', 'Ahmen has been very active on the Facebook page, defending against negative posts. He messaged us asking if he could meet with someone to learn how to become a Christian. He likes that the page is in Arabic and he can still meet with someone while living abroad.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10014, 10049, 'Mary Smith', 'marketer1@disicple.tools', '', '162.243.29.229', '2018-05-29 14:07:45', '2018-05-29 14:07:45', 'This contact lives in Gibraltar, but used to live in Madrid. She speaks Spanish fluently. She has been messaging back and forth with me for a few weeks, and seems very interested in talking. She seems very intelligent, and desired to learn more, but is reluctant to bring shame to her elderly parents. She is working on her masters in psychology.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
  (10015, 10050, 'David Smith', 'marketer2@disciple.tools', '', '162.243.29.229', '2018-05-29 14:11:00', '2018-05-29 14:11:00', 'His parents moved to Spain seeking asylum 20 years ago. He recently found our page and states that he is a Christian. His parents are MBB background which is why they had to leave their country in Syria. He states that he would like to get involved helping other refugees and Arab speakers learn about Jesus. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10016, 10051, 'Mary Smith', 'marketer1@disicple.tools', '', '162.243.29.229', '2018-05-29 14:11:11', '2018-05-29 14:11:11', 'He\'s atheist and a philosophy student and wants to read the Bible.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
  (10017, 10052, 'David Smith', 'marketer2@disciple.tools', '', '162.243.29.229', '2018-05-29 14:12:56', '2018-05-29 14:12:56', 'He wants to meet with someone face to face. He is asking a lot of good questions and seems like a ready contact for face to face', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10018, 10053, 'David Smith', 'marketer2@disciple.tools', '', '162.243.29.229', '2018-05-29 14:14:46', '2018-05-29 14:14:46', 'She wants to read the Bible with someone face to face.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10019, 10054, 'David Smith', 'marketer2@disciple.tools', '', '162.243.29.229', '2018-05-29 14:17:05', '2018-05-29 14:17:05', 'Met a Christian in his country and after working in Spain, wanting to meet more Christians. Seems like he has read quite a bit of the Bible before. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10020, 10055, 'David Smith', 'marketer2@disciple.tools', '', '162.243.29.229', '2018-05-29 14:19:36', '2018-05-29 14:19:36', 'Ready to meet with someone face to face', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10021, 10056, 'David Smith', 'marketer2@disciple.tools', '', '162.243.29.229', '2018-05-29 14:20:28', '2018-05-29 14:20:28', 'Ready to meet with someone face-to-face', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10022, 10037, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '162.243.29.229', '2018-05-29 14:39:10', '2018-05-29 14:39:10', '@[Christopher Berganza (multiplier)](11) This guy filled out our webform, wanting to know more about Jesus, and gave his phone number. Would you be able to call him and see where he\'s at and if he would like to meet up?', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
  (10023, 10038, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '162.243.29.229', '2018-05-29 14:42:53', '2018-05-29 14:42:53', '@[Christopher Berganza (multiplier)](11)  new guy in Castilla. Can you try to meet with him when you travel there next?', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
  (10024, 10039, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '162.243.29.229', '2018-05-29 14:44:24', '2018-05-29 14:44:24', '@[Christopher Berganza (multiplier)](11) This guy is down in Morocco, but has said he wants to become a Christian. Can you call him and see if he would be willing to meet you halfway?', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
  (10025, 10040, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '162.243.29.229', '2018-05-29 14:45:17', '2018-05-29 14:45:17', '@[Christopher Berganza (multiplier)](11) Found a guy actually near you! Please call him and find out where he\'s at.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
  (10026, 10042, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '162.243.29.229', '2018-05-29 14:47:41', '2018-05-29 14:47:41', '@[Isabel Arboleda (multiplier)](9) This lady would like to find out more. Can you call her and try to meet?', 0, 'post-trashed', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
  (10027, 10043, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '162.243.29.229', '2018-05-29 14:51:18', '2018-05-29 14:51:18', '@[Christopher Berganza (multiplier)](11) This contact said he\'s not interested on the webform, but took the time anyway to fill out the form and give us his phone number. It might be worth giving him a call anyway.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
  (10028, 10045, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '162.243.29.229', '2018-05-29 14:52:51', '2018-05-29 14:52:51', '@[Isabel Arboleda (multiplier)](9) Would you be able to meet up with Saira to give a Bible? She lives in Catalonia.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
  (10029, 10041, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '162.243.29.229', '2018-05-29 14:53:15', '2018-05-29 14:53:15', '@[Anthony Palacio (multiplier)](10) See my note on this guy below. Can you give him a call today?', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1007),
  (10030, 10047, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '162.243.29.229', '2018-05-29 14:53:57', '2018-05-29 14:53:57', '@[Christopher Berganza (multiplier)](11) This guy is trying to learn more. He said he lives in Aragon, but ask him if he would meet you halfway.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
  (10031, 10055, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '162.243.29.229', '2018-05-29 14:55:04', '2018-05-29 14:55:04', '@[Anthony Palacio (multiplier)](10) This guy has been discussing some deep stuff on FB. I think he should probably go ahead and meet with someone face to face. You can check out the convo on FB if you log-in if you would like some more context. But remember, don\'t bring up what you read about him say because you don\'t want to creep him out.  See if he is willing to meet you soon.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1007),
  (10032, 10049, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '162.243.29.229', '2018-05-29 14:55:06', '2018-05-29 14:55:06', '@[Isabel Arboleda (multiplier)](9) Check out the comment below. Please call Charifa and see if you can meet.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
  (10033, 10051, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '162.243.29.229', '2018-05-29 14:56:14', '2018-05-29 14:56:14', '@[Christopher Berganza (multiplier)](11) Would you try and meet up with Youssouf to give him a Bible?', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
  (10034, 10048, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '162.243.29.229', '2018-05-29 14:56:15', '2018-05-29 14:56:15', '@[Anthony Palacio (multiplier)](10) When are you heading to Castilla region? I have this guy and a couple others you could try to meet up with on your next round. Let me know and I will assign you all of them.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1007),
  (10035, 10048, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-05-29 15:03:36', '2018-05-29 15:03:36', '@[Rachel Black (dispatcher)](7) I am actually planning on going there next week. Send them all my way and I will contact them today.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1010),
  (10036, 10048, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '162.243.29.229', '2018-05-29 15:04:51', '2018-05-29 15:04:51', '@[Anthony Palacio (multiplier)](10) Perfect! Thanks for the quick reply.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1007),
  (10037, 10054, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '162.243.29.229', '2018-05-29 15:07:18', '2018-05-29 15:07:18', '@[Anthony Palacio (multiplier)](10) Here is guy #2 from Castilla. He is also Tunisian. I wonder if there is a population of them growing out there. See what you can find out, ok? Thanks!', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1007),
  (10038, 10056, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '162.243.29.229', '2018-05-29 15:07:50', '2018-05-29 15:07:50', '@[Anthony Palacio (multiplier)](10) Here is guy #3 from Castilla. He hasn\'t mention where he is from originally.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1007),
  (10039, 10045, 'Isabel Arboleda (multiplier)', 'multiplier1@disciple.tools', '', '162.243.29.229', '2018-05-29 15:11:37', '2018-05-29 15:11:37', 'I called Saira and she seems keen to meet up. She says she\'s not sure what to believe anymore and wants to read more to decide for herself. She is 17 and in her final year at school. She is busy this week with exams so I will call her again next week.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1009),
  (10040, 10054, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-05-29 15:14:44', '2018-05-29 15:14:44', 'Phone Call Notes: \n\n- This guy is hungry!\n- Someone gave him a Bible in Tunisia\n- Starting working in Spain 2 years ago\n- Has another friend he has been talking to (invited him to join us)\n- His friend\'s name is Mazifa\n- Available to meet next week (monday-wed for coffee after work)\n- Scheduled for Tuesday at 5:30 pm. Will meet in front of the big statue on the Main St.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1010),
  (10041, 10049, 'Isabel Arboleda (multiplier)', 'multiplier1@disciple.tools', '', '162.243.29.229', '2018-05-29 15:17:00', '2018-05-29 15:17:00', '@[Damián Abellán (Dispatcher)](6) I\'m sorry, I\'m not able to travel as far as Gibraltar - it\'s a bit too far for me, without a car. Please can you assign this to someone else?', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1009),
  (10042, 10048, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-05-29 15:18:40', '2018-05-29 15:18:40', 'Phone Call notes:\n\n- He called while I was on the phone with Amesfal. \n- Called back and he answered this time\n- He was super excited about my call. He has been actually reading a ton of our articles on our website. \n- Asked him if he had any friends that he could bring with him and he said he didn\'t know of any interested like him\n- Encouraged him to think of others open minded like him and feel free to have them join us\n- Scheduled to meet for Tuesday lunch at 12:30 pm.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1010),
  (10043, 10049, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '162.243.29.229', '2018-05-29 15:20:32', '2018-05-29 15:20:32', '@[Jane Doe (multiplier)](4) Would you be able to travel to Gibraltar, or get Charifa to meet you halfway?', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
  (10044, 10041, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-05-29 15:22:46', '2018-05-29 15:22:46', '@[David Smith](8) Hey bud, I gave this guy a call but it was the wrong number. Can you message him again on FB and double check with him on the number? Thanks!', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1010),
  (10045, 10045, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '162.243.29.229', '2018-05-29 15:25:18', '2018-05-29 15:25:18', '@[Isabel Arboleda (multiplier)](9) Since she is 17, it might be a good idea to ask if her parents are fine with her bringing a Bible home. You can always show her how to get it on her phone (in fact, it\'s good to do this anyway), if she can\'t have one at home. We try to be careful with minors.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
  (10046, 10050, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-05-29 15:27:52', '2018-05-29 15:27:52', 'Phone Call Notes:\n\n- This guy is passionate! Man, I like this guy.\n- He told me a similar story as David mentioned, told him to tell me more when we meet\n- He really wants to meet. He said he is available tomorrow morning.\n- Meeting at 9 am at the main roundabout with the big flag', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1010),
  (10047, 10056, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-05-29 15:33:17', '2018-05-29 15:33:17', 'Phone Call Notes:\n\n- This guy feels sketchy to me. Maybe he is scared because he is dodging my questions a bit. \n- I told him my friend David gave me his number but he was still unsure and didn\'t really want to meet\n\n@[David Smith](8)  Can you make sure this guy is actually ready or reassure him?', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1010),
  (10048, 10048, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '162.243.29.229', '2018-05-29 15:35:07', '2018-05-29 15:35:07', '@[Anthony Palacio (multiplier)](10) This sounds great! I will let our prayer champion know about your meeting.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1007),
  (10049, 10041, 'David Smith', 'marketer2@disciple.tools', '', '162.243.29.229', '2018-05-29 15:46:18', '2018-05-29 15:46:18', '@[Anthony Palacio (multiplier)](10) Ah, man, I am sorry. I submitted the wrong number. I just changed it.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10050, 10056, 'David Smith', 'marketer2@disciple.tools', '', '162.243.29.229', '2018-05-29 15:48:11', '2018-05-29 15:48:11', '@[Anthony Palacio (multiplier)](10) I talked to him again, I realized I never told him my name. We talked a bit and her understands now that you are my friend and will be traveling to his area next week. Give him another call.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10051, 10056, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-05-29 15:58:07', '2018-05-29 15:58:07', 'Meeting Notes:\n\n- Was much more relaxed and willing to meet.\n- Scheduled for next Tuesday in the morning at 7 am.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1010),
  (10052, 10049, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-05-29 16:12:41', '2018-05-29 16:12:41', '@[Damián Abellán (Dispatcher)](6) Yeah I was going to make a special south trip next week, feel free to send me anyone living in the sound between now and next week. Maybe assign eastern folks to Isabel?', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
  (10053, 10049, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-05-29 16:14:31', '2018-05-29 16:14:31', 'Phone Call Notes:\n\n- She is very eager to meet\n- She wants to bring her roommate which is great!\n- We will meet next week on Tuesday after her classes finish around 4 pm. I will call her next week to confirm a time.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
  (10054, 10053, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-05-29 16:18:40', '2018-05-29 16:18:40', '@[David Smith](8) Can you add her FB name. I would like to read the conversation between you guys a bit more.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
  (10055, 10038, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-05-30 14:09:09', '2018-05-30 14:09:09', 'Ismail seems eager to meet and is willing to come into Madrid to meet. We will try to meet this Saturday.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
  (10056, 10039, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-05-30 14:10:42', '2018-05-30 14:10:42', 'No answer today. Will try again tomorrow.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
  (10057, 10040, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-05-30 14:12:01', '2018-05-30 14:12:01', 'We talked on the phone for a while. He has a lot of questions. He did ask if I could give him a Bible. We will try to meet tomorrow evening.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
  (10058, 10043, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-05-30 14:13:19', '2018-05-30 14:13:19', 'He said he was busy and will call me back.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
  (10059, 10047, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-05-30 14:16:00', '2018-05-30 14:16:00', 'I have talked with Tarik on the phone twice already, in 3 days! He has a lot of questions, but also just seems to need a friend. He isn\'t able to travel this week, but has to come to Madrid in a week for business.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
  (10060, 10051, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-05-30 14:18:13', '2018-05-30 14:18:13', 'I will try to call him tonight and see where he lives in Castilla y Leon, if he\'s close to Madrid, I should be able to meet with him this week.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
  (10061, 10050, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '173.239.240.131', '2018-06-01 12:02:39', '2018-06-01 12:02:39', 'This guy is the real deal! He shared more details about his story with me. He comes from a seemingly grounded Biblical family. He has been baptized and has a strong relationship with the Lord. He says he is very interested in getting involved in sharing his faith and seemed very teachable.\n\nI would like to help coach him on being able to share his story/testimony in different fragments of time. I would also like that we put together a list of 100 people he knows in his life and start casting vision about sharing His story and God\'s story with those people. \n\nHe wants to meet again this week.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10062, 10048, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '173.239.240.131', '2018-06-01 12:14:58', '2018-06-01 12:14:58', 'What a great first meeting! He didn\'t bring anyone with him. I shared the creation to Christ story with him to set up the basis that the Bible is a full story, made complete in Christ. We read Matthew 1-7 together in our meeting. He kept speaking a lot about how different it was than Islam.\n\nI encouraged him to read the entire book of Matthew nothing stories and words Jesus uses about what it means to follow Him. I told him to give me a call when he is finished reading it and ready to meet again.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10063, 10056, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '173.239.240.131', '2018-06-01 12:16:35', '2018-06-01 12:16:35', 'I called Mohammed the day before, the day of, during when were supposed to meet and he didn\'t answer.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10064, 10054, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '173.239.240.131', '2018-06-01 12:24:46', '2018-06-01 12:24:46', 'Amesfal brought Mazifa. He met him in Spain and began sharing with him what he had been learning about God from the Injil. We started reading Matthew. Amesfal was very talkative so it was sometimes difficult to gauge where Mazifa was in it all. We read Matthew 5 like a DBS (Discovery Bible Study). This helped Mazifa have a chance to talk more. Had to really push the DNA of asking them, \"Where do you see that in the passage?\" By the end, they were automatically doing that. I encouraged them to read the Book of Matthew. I casted vision of other Tunisians like them discovering, sharing, and obeying God\'s Word together. It excited them.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10065, 10060, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '173.239.240.131', '2018-06-01 12:27:14', '2018-06-01 12:27:14', 'Friend that Amesfal brought with him to our first meeting', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10066, 10041, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '173.239.240.131', '2018-06-01 12:39:01', '2018-06-01 12:39:01', 'Set up a meeting for tomorrow at 7 pm.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10067, 10055, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '173.239.240.131', '2018-06-01 12:39:45', '2018-06-01 12:39:45', 'Wow! He is willing to meet today!', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10068, 10052, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '173.239.240.131', '2018-06-01 12:40:44', '2018-06-01 12:40:44', '@[David Smith](8) Is this the right number? This guy hasn\'t been answering. Could you check with him on FB?', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10069, 10052, 'David Smith', 'marketer2@disciple.tools', '', '173.239.240.131', '2018-06-01 12:46:12', '2018-06-01 12:46:12', '@[Anthony Palacio (multiplier)](10) Yeah this is the right number but it seems that he has turned off his Facebook account so I am unable to contact him and ask. Try calling him a few more times and then maybe we put him on pause.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10070, 10061, 'David Smith', 'marketer2@disciple.tools', '', '173.239.240.131', '2018-06-01 13:00:03', '2018-06-01 13:00:03', 'This guy is super argumentative on the page. He has contacted us wanting to know who is behind the page. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10071, 10062, 'David Smith', 'marketer2@disciple.tools', '', '173.239.240.131', '2018-06-01 13:03:08', '2018-06-01 13:03:08', 'This guy is wanting a Book. He doesn\'t want to meet with anyone though. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10072, 10062, 'David Smith', 'marketer2@disciple.tools', '', '173.239.240.131', '2018-06-01 13:04:49', '2018-06-01 13:04:49', '@[Rachel Black (dispatcher)](7) Can you contact the Book mailers to get a Book mailed out to this guy?', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10073, 10063, 'David Smith', 'marketer2@disciple.tools', '', '173.239.240.131', '2018-06-01 13:42:21', '2018-06-01 13:42:21', 'This girls says she wants to become a believer.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10074, 10064, 'David Smith', 'marketer2@disciple.tools', '', '173.239.240.131', '2018-06-01 13:45:24', '2018-06-01 13:45:24', 'Says he is a believer and wants to be baptized.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10075, 10065, 'David Smith', 'marketer2@disciple.tools', '', '173.239.240.131', '2018-06-01 14:00:40', '2018-06-01 14:00:40', 'He says that he is a Muslim but wants to know more about the Messiah, the Christian religion, and the Injil. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10076, 10066, 'David Smith', 'marketer2@disciple.tools', '', '173.239.240.131', '2018-06-01 14:08:13', '2018-06-01 14:08:13', 'In FB private message, he clicked on the FB bot\'s option \"I want to receive the Book in person\"', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10077, 10067, 'David Smith', 'marketer2@disciple.tools', '', '173.239.240.131', '2018-06-01 14:12:30', '2018-06-01 14:12:30', 'This actually lady contacted our prayer network\'s FB page. Says she is wanting to meet other Christians who grew up Muslim in Spain. The network facilitator pointed her to our FB page and she she private messaged us for a meeting', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10078, 10068, 'David Smith', 'marketer2@disciple.tools', '', '173.239.240.131', '2018-06-01 14:18:14', '2018-06-01 14:18:14', 'He wants to read the Bible with someone', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10079, 10063, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '173.239.240.131', '2018-06-01 14:30:05', '2018-06-01 14:30:05', '@[Isabel Arboleda (multiplier)](9) Can you contact this girl ?', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1007),
  (10080, 10064, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '173.239.240.131', '2018-06-01 14:31:19', '2018-06-01 14:31:19', 'Can you contact this guy and try to meet with him?', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1007),
  (10081, 10065, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '173.239.240.131', '2018-06-01 14:31:59', '2018-06-01 14:31:59', '@[Anthony Palacio (multiplier)](10) Are you able to follow up with this guy?', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1007),
  (10082, 10049, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '173.239.240.131', '2018-06-01 14:39:25', '2018-06-01 14:39:25', 'Sharif brought her roommate Aisha. We started reading in Matthew together. They read in Arabic and explained the passage to me. I asked them DBS style questions as we went. Toward the end, they were both very convinced that this was the true way. They said they want to learn how to becomes Christians. I encouraged them to keep reading Matthew and take note of what it means to follow Jesus and we could all meet again and talk about it. They were excited to both receive a Bible. Aisha even kissed her\'s!', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
  (10083, 10067, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '173.239.240.131', '2018-06-01 14:41:53', '2018-06-01 14:41:53', 'Planning to meet this Thursday for coffee at 7 pm.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
  (10084, 10053, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '173.239.240.131', '2018-06-01 14:44:02', '2018-06-01 14:44:02', 'Scheduled a meeting for tomorrow at 1 pm', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
  (10085, 10066, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '173.239.240.131', '2018-06-01 14:49:38', '2018-06-01 14:49:38', 'Note: He was already baptized\n Met with Nassim. Very interesting guy and I want to continue meeting with him. He came to faith four years ago and has been alone for most of his walk with the Lord. He actually got baptized by someone in Morocco. He hasn\'t had any regular fellowship though since that group stopped meeting. I talk to him about the vision of starting a group of other Moroccans in Extremadura. He got really excited and we read through Acts one and two. I used it to cast a vision that a church could be started anywhere and he really caught on to the idea. Then we walked through Matthew 1-4 and I modeled for him how he could do this without others. I told him to make a list of 100 and he already had some ideas of who he could share with. He was super grateful that I had came out and met with him and very excited that he had someone to talk to. He has two sisters, both are married, one of them is married to a Spanish Christian and the other one is married to another Muslim guy from Morocco. Apparently his parents are very open-minded.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10086, 10065, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '173.239.240.131', '2018-06-01 14:51:09', '2018-06-01 14:51:09', '@[David Smith](8) Can you ask him for his real number? This one doesn\'t work.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10087, 10064, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '173.239.240.131', '2018-06-01 14:52:15', '2018-06-01 14:52:15', 'He is in the middle of studying, has read two books of the NT in spanish. Wants to meet up but is busy with studies. Told him to start reading Matthew and we would discuss it when we met.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10088, 10066, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '173.239.240.131', '2018-06-01 14:56:48', '2018-06-01 14:56:48', 'May 15- met with Nassim again. It was a good meeting. We read through Matthew 5-10. We talked about bringing in a friend and having him walk them through Matthew 1- 10. At the end of our meeting he talked about us needing to get together for a longer period of time so that he could invite someone and we can walk them through Matthew. Hopefully we will do that soon. I actually had him walk me through Matthew five through 10 next and teach it to me and just gave him suggestions on how better to explain. I think it helped gave him confidence that he can do this on his own.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10089, 10066, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '173.239.240.131', '2018-06-01 14:57:59', '2018-06-01 14:57:59', 'May 20: Not free over the next three days. Says Mon or Fri can maybe meet.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10090, 10066, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '173.239.240.131', '2018-06-01 14:58:22', '2018-06-01 14:58:22', 'Ok, we will meet Friday.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10091, 10066, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '173.239.240.131', '2018-06-01 14:59:20', '2018-06-01 14:59:20', 'Nassim cancelled today because his dad is sick but he is done with classes this week and will have a break on Wednesday. Said to come anytime.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10092, 10066, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '173.239.240.131', '2018-06-01 15:00:32', '2018-06-01 15:00:32', 'Line is now busy.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10093, 10066, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '173.239.240.131', '2018-06-01 15:01:12', '2018-06-01 15:01:12', 'called no answer. Line still busy.  Haven\'t been able to get ahold of this guy for months.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10094, 10064, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '173.239.240.131', '2018-06-01 15:03:03', '2018-06-01 15:03:03', 'After the weekend, he is going to find us a good place to meet and a time that works.\n He has actually read all four gospels and Acts. He is currently reading Romans. He says he can\'t meet until Spring Break because that\'s the first break he gets from class but I told him I could see him', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10095, 10064, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '173.239.240.131', '2018-06-01 15:04:01', '2018-06-01 15:04:01', 'He could only meet on Saturday and I was already booked solid. Will try next Saturday', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10096, 10064, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '173.239.240.131', '2018-06-01 15:09:27', '2018-06-01 15:09:27', 'May 17- Met with the new guy Nabil today. We met downtown. He is 15 years old. He is studying and about four years ago saw a documentary on how Arabs invaded North African and tried forcing many of the Berbers to change. He decided he wouldn\'t go back to Islam. He\'s been to the mosque to pray but he just felt like it was wrong. he wanted to see some signs. Started reading the Bible. One day he was sitting in a park and he felt a burning sensation in the palms of his hand, where they crucified Jesus. And then he saw two doves fly by in the direction of downtown. He took it as a sign that he needed to go downtown and when he went downtown he found a bookseller and the bookseller just happen to have a copy of the Bible in Arabic.  Up until then He had mostly been reading it online and from Facebook. He has read Matthew through Romans and is currently in first Corinthian\'s. We read from Matthew 1-6 as well as Matthew 28. He got the vision and he wants to be baptized. He actually considers himself a believer since last November. He was praying and asking God for help and then I called him. His dad is a dentist here and an atheist. He lived in Portugal for a while. His mother is Muslim but she\'s not very strong in the faith. They already know that he\'s a Christian. They don\'t have a problem with it.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10097, 10064, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '173.239.240.131', '2018-06-01 15:11:19', '2018-06-01 15:11:19', 'He continues to study and read through the Bible. He has finished all the Gospels and the Epistles up to 1 Peter. Good questions so far and growing in his understanding. He is also in the middle of exams and can\'t really meet but at least he has continued to study the Word.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10098, 10069, 'Mary Smith (marketer)', 'marketer1@disicple.tools', '', '165.227.220.74', '2018-06-01 15:29:59', '2018-06-01 15:29:59', 'This man became attracted  to Christianity through TV, he has never read a Gospel nor met a believer, but he would like to do both. He lives in Madrid.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
  (10099, 10069, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '165.227.220.74', '2018-06-01 15:40:46', '2018-06-01 15:40:46', '@[Christopher Berganza (multiplier)](11) Here is another from Madrid.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
  (10100, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '165.227.220.74', '2018-06-01 15:43:25', '2018-06-01 15:43:25', 'He has watched brother Rashed on TV but has never read a Bible and doesn\'t have a smartphone. Meeting arranged for Saturday at 12pm in town. Will call Saturday to confirm and decide on location.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
  (10101, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '165.227.220.74', '2018-06-01 15:46:00', '2018-06-01 15:46:00', 'Meeting went well. He wanted to read the Bible. Gave him NT. Shared the Gospel with him and gave him the intro to Matthew. Reading comprehension was pretty good.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
  (10102, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '165.227.220.74', '2018-06-01 15:52:36', '2018-06-01 15:52:36', 'Met with Wasim again today. He is further along. Finished reading Matthew. Understood a lot of the big ideas but is still thinking from an Islamic mindset. Hopefully more time in the word will change that. Will have him read the book of John next and then acts. We looked at several passages today.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
  (10103, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '165.227.220.74', '2018-06-01 15:56:34', '2018-06-01 15:56:34', 'I called a few times to see how he was doing - no answer, then he called back and missed me.\nI called again and he didn\'t have work today so we set a time to meet. Wasim had already finished reading John since last week. I felt led to read through Matthew 5, so he read a section and then we talked about each section all the way through Matthew 5. He expressed two times that he has entered into being a follower now.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011);
INSERT INTO `dt14330_comments` (`comment_ID`, `comment_post_ID`, `comment_author`, `comment_author_email`, `comment_author_url`, `comment_author_IP`, `comment_date`, `comment_date_gmt`, `comment_content`, `comment_karma`, `comment_approved`, `comment_agent`, `comment_type`, `comment_parent`, `user_id`) VALUES
  (10104, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '165.227.220.74', '2018-06-01 15:59:08', '2018-06-01 15:59:08', 'Met with Wisam. It was a great meeting. He has read up to revelation. More exciting is that he has had a dream last night. He saw Jesus appear to him. Jesus told him \"if you love me you will love Allah. I will love you\" I showed him John 14 \"I am the way the truth and the life...\" He said \"that\'s what Jesus was telling me!!!\" I have been reading, now what do I have to do, I want to do more than read I want to follow Jesus. I showed him acts 2. Repent and be baptized. He wanted to get baptized tomorrow already! Praise God.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
  (10105, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '165.227.220.74', '2018-06-01 16:03:09', '2018-06-01 16:03:09', 'Praise God!', 0, 'trash', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
  (10106, 10069, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '165.227.220.74', '2018-06-01 16:05:29', '2018-06-01 16:05:29', 'Praise God!', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
  (10107, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '165.227.220.74', '2018-06-01 16:18:03', '2018-06-01 16:18:03', 'Met up with Wisam. We traveled over to the coast to baptize him. On the way out he was talking about how he wanted to be an ambassador for Christ and get the word out to everyone. I asked him to retell how he came to know Christ. He talked about searching. Comparing the Koran and Injil. Then he had a dream. Jesus appeared to him. In a white robe and a bright light. His face was covered in light. He said \"you are my son (child) follow me.\" He said he felt peace and mercy and joy like he never had before. Then he woke up. There was no turning back after that.\n When he was baptized he said he felt like a new man, something powerful happened. We studied acts 1-3 together. He is really catching the vision.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
  (10108, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '165.227.220.74', '2018-06-01 16:23:23', '2018-06-01 16:23:23', 'It has been a week since Wasim got baptized and he had a second dream last night. Jesus appeared to him and told him to not be afraid. I am sending you to tell others about me, to many other nations.\nPTL! He is re-reading Acts now.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
  (10109, 10067, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-06-05 15:48:09', '2018-06-05 15:48:09', 'We had a great meeting. Read through Matthew 1-5. I could tell she was getting tired toward the end of 5, so I encouraged her to keep reading on her own and contact me when she is finished reading Matthew. \n\nBefore she started to show signs of being tired, she was very engaged in the Word and had lots of good questions. I told her to write down her questions and wait and see if the Bible answers them for her. Just like a good story, we have to wait and see what happens.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
  (10110, 10046, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-06-05 15:49:38', '2018-06-05 15:49:38', 'Excited to meet. Was studying all week but is done with her finals for this semester. Plan to meet this Thursday night at 7 pm.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
  (10111, 10049, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-06-05 15:53:40', '2018-06-05 15:53:40', 'Met with Sharif and Aisha again. They both read through Matthew and were excited to meet again. They really dug into the Book and had lots of great insights as they explained back what they had learned and discovered. They both expressed that they believe that Jesus is more than a prophet and want to keep reading the Bible and learn more. I asked them to explain to me what they think it means to follow Jesus and be a Christian. We started reading in the Book of John together. They are going to read that Book and call me when they are finished with it.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
  (10112, 10071, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-06-05 15:55:06', '2018-06-05 15:55:06', 'Friend of Charif.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
  (10113, 10071, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-06-05 15:55:43', '2018-06-05 15:55:43', 'Met with Sharif and Aisha again. They both read through Matthew and were excited to meet again. They really dug into the Book and had lots of great insights as they explained back what they had learned and discovered. They both expressed that they believe that Jesus is more than a prophet and want to keep reading the Bible and learn more. I asked them to explain to me what they think it means to follow Jesus and be a Christian. We started reading in the Book of John together. They are going to read that Book and call me when they are finished with it.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
  (10114, 10070, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-06-05 15:56:31', '2018-06-05 15:56:31', 'Met with Sharif and Aisha again. They both read through Matthew and were excited to meet again. They really dug into the Book and had lots of great insights as they explained back what they had learned and discovered. They both expressed that they believe that Jesus is more than a prophet and want to keep reading the Bible and learn more. I asked them to explain to me what they think it means to follow Jesus and be a Christian. We started reading in the Book of John together. They are going to read that Book and call me when they are finished with it.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
  (10115, 10053, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-06-05 15:59:04', '2018-06-05 15:59:04', 'I tried calling her the morning of and an hour before but she didn\'t answer. I decided to show up this time but she didn\'t show. I will try to call her again and see what happened and try to reschedule.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
  (10116, 10072, 'David Smith', 'marketer2@disciple.tools', '', '162.243.29.229', '2018-06-05 16:07:16', '2018-06-05 16:07:16', 'Wants a Book mailed. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10117, 10073, 'David Smith', 'marketer2@disciple.tools', '', '162.243.29.229', '2018-06-05 16:08:17', '2018-06-05 16:08:17', 'A young, high school girl wants to receive a Book and meet a Christian. ', 0, 'post-trashed', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10118, 10074, 'David Smith', 'marketer2@disciple.tools', '', '162.243.29.229', '2018-06-05 16:09:56', '2018-06-05 16:09:56', 'A wife wants to learn how to become a Christian. She said her husband has been watching satellite Christian programs, and they are both wanting to receive a Bible. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10119, 10075, 'David Smith', 'marketer2@disciple.tools', '', '162.243.29.229', '2018-06-05 16:11:02', '2018-06-05 16:11:02', 'Wants to receive a Bible', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10120, 10076, 'David Smith', 'marketer2@disciple.tools', '', '162.243.29.229', '2018-06-05 16:14:25', '2018-06-05 16:14:25', 'Read Matthew online 1-10. Says she wants to receive an actual Book.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10121, 10077, 'David Smith', 'marketer2@disciple.tools', '', '162.243.29.229', '2018-06-05 16:16:26', '2018-06-05 16:16:26', 'A woman living in Morocco contacted our FB page and says she doesn\'t know any Christians but wants to meet one. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10122, 10078, 'David Smith', 'marketer2@disciple.tools', '', '162.243.29.229', '2018-06-05 16:17:41', '2018-06-05 16:17:41', 'Been talking on our FB chat for a long time. I think she is ready to meet offline.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10123, 10065, 'David Smith', 'marketer2@disciple.tools', '', '162.243.29.229', '2018-06-06 11:43:06', '2018-06-06 11:43:06', '@[Anthony Palacio (multiplier)](10) Here is his real number', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10124, 10079, 'David Smith', 'marketer2@disciple.tools', '', '162.243.29.229', '2018-06-06 11:44:38', '2018-06-06 11:44:38', 'He wants to receive a Book', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10125, 10080, 'David Smith', 'marketer2@disciple.tools', '', '162.243.29.229', '2018-06-06 11:46:26', '2018-06-06 11:46:26', 'He wants to read the Bible with a Christian and learn more about the Christian religion', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10126, 10081, 'David Smith', 'marketer2@disciple.tools', '', '162.243.29.229', '2018-06-06 11:47:03', '2018-06-06 11:47:03', 'He wants a Book mailed to him only', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10127, 10068, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-06-06 11:53:26', '2018-06-06 11:53:26', 'He is interested in studying. Lives near by and don\'t have a Book. Wants to meet tomorrow.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10128, 10068, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-06-06 11:54:19', '2018-06-06 11:54:19', 'met and gave him a Book. His family was in the car and so we werent able to meet for long. He works downtown though and we hope to meet during the week.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10129, 10068, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-06-06 11:54:43', '2018-06-06 11:54:43', 'He called me back and wants to meet up. Would like to meet saturday.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10130, 10068, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-06-06 12:00:32', '2018-06-06 12:00:32', 'May 19- met with Sabri. He is a really nice guy. Paid for the coffee. Wants to learn more because he is worried about the extremists and what they are teaching his kids in the schools. He is an IT guy. His wife also works. They have 2 kids. Both teenagers. He is very open and so is his wife he wants to study this with his kids. We walked through Matthew 1-3 and he liked it and really thought it was easy to understand. I shared the gospel with him and he received it well. We talked about meeting downtown for lunch.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10131, 10068, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-06-06 12:01:43', '2018-06-06 12:01:43', 'He has been busy with a work conference but hopes to meet for lunch tomorrow or this weekend.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10132, 10068, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-06-06 12:02:17', '2018-06-06 12:02:17', 'He has been busy with work but would like to meet up on  Tuesday or Thursday for lunch.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10133, 10068, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-06-06 12:02:57', '2018-06-06 12:02:57', 'I am back from a trip. He doesn\'t work on Sunday. May meet up Sunday.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10134, 10068, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-06-06 12:05:07', '2018-06-06 12:05:07', 'His phone is off now. I haven\'t been able to get a hold of him for months now.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10135, 10065, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-06-06 14:06:18', '2018-06-06 14:06:18', 'He is 16 years old. More curious than anything else. His mom actually brought him, kind of awkward. She spent the first 20 min explaining that he was a good boy. She didn\'t want him getting into trouble but didn\'t care if he read the Book. Just didn\'t want him smoking. Her husband left them and that made life difficult. The kid doesn\'t have a lot of friends but meets people online on facebook. She then left and said she would be across the street and we could talk. The boy is more curious. Doesn\'t know much but wants to read.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10136, 10065, 'David Smith', 'marketer2@disciple.tools', '', '162.243.29.229', '2018-06-06 14:30:06', '2018-06-06 14:30:06', '@[Anthony Palacio (multiplier)](10) He wrote to me and asked if we can give him another copy of the Book because he has a group of friends interested in reading it', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10137, 10064, 'David Smith', 'marketer2@disciple.tools', '', '162.243.29.229', '2018-06-06 14:31:49', '2018-06-06 14:31:49', '@[Anthony Palacio (multiplier)](10) He asked online about baptism. He said that he wants to be baptised but he is afraid because of sin.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10138, 10065, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-07-02 14:34:21', '2018-07-02 14:34:21', 'I met with Ali in his house and talked with his uncle, his mother and grandmother. I think they are not very interested in Christianity but Ali has been reading the New Testament and has been sharing with his friends from school and 3 of them asked him for the New Testament because they are interested to reading.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1010),
  (10139, 10065, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-07-02 14:35:55', '2018-07-02 14:35:55', 'I met with him at his house. He has finished reading the NT but it was a quick read, he is going to go back and read through it slowly. He has three friends from school that are all reading the Bible (Ali gave them the Bibles we brought to him) two girls and a boy. One of the girls finished reading through the NT already and requested an OT. Ali has a complete Bible to give her. Also showed him how to get the Bible app on his phone so that he can share that with others. He is following the 40 Days with Jesus campaign. He is prgressng but it is impossible for him to meet with his friends to study. Each of them studies on their own. Would be cool to have an online format (FB group or something) in which people could follow the DBS model.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1010),
  (10140, 10065, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-07-02 14:38:16', '2018-07-02 14:38:16', 'Met with him yesterday. He is in the middle of exams. He is still investigating and has 3 friends who are also still interested but struggling to understand what they are reading. He requested some kind of study Bible. we have met with him multiple times in his home but it is a rougher part of town concentrated with Arabs. He told us that his neighbors knew we were coming and that Ali was only welcoming us because he wanted to change his religion. Ali said that it didn\'t bother him but we feel its more prudent not to continue to visit him in his home. We talked to Ali about starting a FB group where he could invite his friends and we could post passages of scripture to help them understand the plan of God. He said he would do that as soon as he finished exams.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1010),
  (10141, 10065, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-07-02 14:38:49', '2018-07-02 14:38:49', 'Has not gotten much traction on starting the FB group to study with his friends. Has finished reading Matthew and is now jumping around the NT.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1010),
  (10142, 10065, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-07-02 14:39:43', '2018-07-02 14:39:43', '@[David Smith](8)  If we have some kind of media playlist that we can put this guy on that would be great. He is interested in knowing more but it has become almost impossible to meet with him.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1010),
  (10143, 10065, 'David Smith', 'marketer2@disciple.tools', '', '162.243.29.229', '2018-07-02 14:41:59', '2018-07-02 14:41:59', '@[Anthony Palacio (multiplier)](10) ok i can keep contact with him and send him our playlist. is that ok?', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1008),
  (10144, 10065, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '162.243.29.229', '2018-07-02 14:43:06', '2018-07-02 14:43:06', '@[David Smith](8)  is this guy resonating with the playlist? Is he still moving through material or has it finished?', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1007),
  (10145, 10065, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-07-02 14:44:32', '2018-07-02 14:44:32', 'He called up and wanted to go to a local church with a friend. Showed up and he brought over a dozen friends. He had to leave early because they have class. It was good overall. Told the group they all need to study and put Ali in charge of starting a Facebook group. Several girls in the group had already read through the NT', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1010),
  (10146, 10065, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-07-02 14:47:06', '2018-07-02 14:47:06', 'Not sure what to do with this contact. He is under age and has attended the local church. He is not security conscience at all and has been doing and posting a lot on Facebook that could get us into some trouble. I think sending him a download link for the full Bible would be best and walk him through the new Matthew study online.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1010),
  (10147, 10064, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-07-02 14:56:25', '2018-07-02 14:56:25', 'June 16th Update: Sorry I\'ve been in contact with this guy and havent updated the record. We had originally planned to do his baptism on June 15 but he had some transportation conflict. I told him I would bring him a full Bible when I see him next. He has finished reading the NT and Psalms and wants to know what to read next', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1010),
  (10148, 10064, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-07-02 14:56:44', '2018-07-02 14:56:44', 'June 27 Updated: He went through a season of depression, things were very rough. He is doing better now. He has finished reading the NT. Hope to see him tomorrow.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1010),
  (10149, 10064, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-07-02 14:58:36', '2018-07-02 14:58:36', 'June 30 Update: Met with Nabil. He had a rough couple of weeks experiencing depression and lots of spiritual attacks. He even confessed to me some sins that he was struggling with. He genuinely wants to repent and follow Jesus and stop sinning, we talked about what that would require how he could receive forgiveness for his sins, what Jesus has done for him. He is finished reading the New Testament wants to read the old I gave him a complete Bible. I encouraged him to reread parts of the New Testament and to read Proverbs. He felt very encouraged by her meeting I share testimonies with him of overcoming sin and he was very encouraged by that.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1010),
  (10150, 10064, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-07-02 15:02:19', '2018-07-02 15:02:19', 'Met with him and it was a good meeting. He is really encouraged by the church and by his experience with other believers so far. He is reading the Bible daily and has good fellowship. He is growing and catching the vision. We read Acts 1-2 again and he was very encouraged by it. There have been some difficulties with his dad and so we prayed for both of his parents.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1010),
  (10151, 10064, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-07-02 15:05:31', '2018-07-02 15:05:31', 'He is happy where he is at with a new group of believers learning and growing, he went to do some lessons with several other believers. Probably will end up sticking with this group.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1010),
  (10152, 10069, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '162.243.29.229', '2018-07-02 15:12:31', '2018-07-02 15:12:31', '@[Christopher Berganza (multiplier)](11) We haven\'t heard from you in a while - do you have an update on Wasim?', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.87 Safari/537.36', 'comment', 0, 1006),
  (10153, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-02 15:14:44', '2018-07-02 15:14:44', '@[Damián Abellán (Dispatcher)](6)  I was traveling for a couple of weeks, but called Wasim when I got back. He has finished Acts and started reading Genesis. Said he was praying for me. He called me back later to ask who the \"Phariseen\" were. He thought maybe they were from Iran but didn\'t understand why they kept having problems with Jesus. Clarified that point for him and he went back to studying.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.87 Safari/537.36', 'comment', 0, 1011),
  (10154, 10062, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '162.243.29.229', '2018-07-02 15:15:02', '2018-07-02 15:15:02', '@[Damián Abellán (Dispatcher)](6) Can you mail the book to this guy?', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1007),
  (10155, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-02 15:15:09', '2018-07-02 15:15:09', 'I met him downtown, we went through John 10, he seemed really solid, loves Jesus, loves the Word...', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.87 Safari/537.36', 'comment', 0, 1011),
  (10156, 10081, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-07-02 15:16:08', '2018-07-02 15:16:08', 'Can you mail this guy a Book?', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1004),
  (10157, 10077, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-07-02 15:17:04', '2018-07-02 15:17:04', 'Visiting Spain next week. Will plan to get coffee.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1004),
  (10158, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-02 15:17:06', '2018-07-02 15:17:06', 'Wasim\'s uncle died, so Wasim went south to be with the family. He called me today, he sounded lonely and in need of fellowship. It sounds like he is pressing on reading the NT. He wrote out a list of 100 people he knows and is praying over it. I tried to encourage him as much as I could. He is really isolated down there. He hasn\'t told anyone in his family, but they continue talking about the change in him.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.87 Safari/537.36', 'comment', 0, 1011),
  (10159, 10076, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-07-02 15:17:39', '2018-07-02 15:17:39', 'Excited to meet. Will do so this Friday. Will call her for exact time in the morning', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1004),
  (10160, 10069, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '162.243.29.229', '2018-07-02 15:17:43', '2018-07-02 15:17:43', 'Praying that his dream about telling others will become reality and that God will work through him.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.87 Safari/537.36', 'comment', 0, 1006),
  (10161, 10074, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-07-02 15:18:30', '2018-07-02 15:18:30', 'Meeting tomorrow.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1004),
  (10162, 10074, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-07-02 15:19:27', '2018-07-02 15:19:27', 'Brought husband and teenage son. They were all so hungry. We read Matthe 1-5 together The whole family participated in the conversation. They each kept mentioning names of people they wanted to share this with.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1004),
  (10163, 10038, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-02 15:20:12', '2018-07-02 15:20:12', 'Called Ismail but he is unavailable for the next two weeks. He still wants to meet however. I may take Wisam with me to meet him.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.87 Safari/537.36', 'comment', 0, 1011),
  (10164, 10085, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-07-02 15:21:28', '2018-07-02 15:21:28', 'Husband of Safiyah', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1004),
  (10165, 10086, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-07-02 15:22:34', '2018-07-02 15:22:34', 'Son of the Ahmad and Safiyah Jouiti. He came with them to the first meeting', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1004),
  (10166, 10074, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-07-02 15:23:28', '2018-07-02 15:23:28', 'Will start commenting on the group feed since they are seeking together.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1004),
  (10167, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-02 15:23:53', '2018-07-02 15:23:53', 'Took him to meet a new contact with me (Ismail) and it went really well. He is stronger on certain parts of the Gospel than others but he was able to help and connect with Ismail. He was able to get Ismail through the first two chapters of Matthew pretty well and explain some of the broader concepts of forgiveness and Christ\'s sacrifice in his own words and with his own illustrations. I still ended up doing a lot of talking but his testimony was powerful and really connected with Ismail (they started in roughly the same place). Wasim wants to review the Matthew study so he will have a better idea on how to move Ismail forward.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.87 Safari/537.36', 'comment', 0, 1011),
  (10168, 10084, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-07-02 15:24:19', '2018-07-02 15:24:19', 'Safiyah contacted the page saying her husband has been watching satellite christian tv and wanted to meet and talk with christians face to face. they brought their son with them and all of them participated and each wanted their own Bible.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1004),
  (10169, 10084, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-07-02 15:25:17', '2018-07-02 15:25:17', 'Second meeting: They all came and this time, the son brought his neighbor friend. They said that they want to keep meeting together. We started doing a Discovery Bible Study. I modeled it for them and in a couple more days, Ahmed is going to lead it. He seems excited to do so.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1004),
  (10170, 10084, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-07-02 15:26:26', '2018-07-02 15:26:26', 'Third meeting: Ahmed did a great job leading the discovery bible study (DBS). They are going through Matthew and have  great questions. I encouraged them to let the Bible answer them for them and write down their questions and if by the end of Matthew they aren\'t answered, then we can discuss them again. The friend came back again.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1004),
  (10171, 10038, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-02 15:26:52', '2018-07-02 15:26:52', 'Took Wasim with me today, to meet Ismail and it went really well. He was able to get Ismail through the first two chapters of Matthew pretty well and explain some of the broader concepts of forgiveness and Christ\'s sacrifice in his own words and with his own illustrations. I still ended up doing a lot of talking but his testimony was powerful and really connected with Ismail. They started roughly in the same place. Ismail wants to meet again soon.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.87 Safari/537.36', 'comment', 0, 1011),
  (10172, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-02 15:27:22', '2018-07-02 15:27:22', 'We met yesterday to study further and prepare him to do the next two chapters of Matthew with Ismail. I had him review the first two chapters of Matthew and then we role played the next two chapters and he did pretty well. He called Ismail and talked with him and arranged to meet him tomorrow. He will continue to walk him through Matthew and is very excited about doing this. He is clear on the vision.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.87 Safari/537.36', 'comment', 0, 1011),
  (10173, 10087, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-07-02 15:27:27', '2018-07-02 15:27:27', 'Neighbor Friend of the Jouiti family', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1004),
  (10174, 10084, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-07-02 15:30:14', '2018-07-02 15:30:14', 'Fourth Meeting: Ahmed did another round of leading the DBS, they kept looking at me for questions. I think I am going to try and meet with Ahmed and his wife outside of the group and coach them.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1004),
  (10175, 10085, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-07-02 15:33:07', '2018-07-02 15:33:07', 'Going to start meeting with Ahmad and his wife to encourage them to meet with their son and his friend and lead them and invite others along. They shared that Safir\'s parents want to come too and plan on joining them tomorrow night for a meal and a discovery study.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1004),
  (10176, 10038, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-02 15:33:10', '2018-07-02 15:33:10', 'Wasim and I met Ismail again this afternoon. He did a good job of connecting with Ismail. I modeled and laid out the Matthew study and he has been very good about following up with Ismail. We met twice with Ismail together and now he is going to meet with him alone. They have been working through Matthew together. Wisam is pretty confident on Matthew 1-3,decent on 4 and is starting on Matthew 5-7.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.87 Safari/537.36', 'comment', 0, 1011),
  (10177, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-02 15:33:44', '2018-07-02 15:33:44', 'Wasim and I met Ismail again this afternoon. He did a good job of connecting with Ismail. I modeled and laid out the Matthew study and he has been very good about following up with Ismail. We met twice with Ismail together and now he is going to meet with him alone. They have been working through Matthew together. Wisam is pretty confident on Matthew 1-3,decent on 4 and is starting on Matthew 5-7.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.87 Safari/537.36', 'comment', 0, 1011),
  (10178, 10085, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-07-02 15:34:32', '2018-07-02 15:34:32', 'Met with Safiyah and she said Safir\'s parents came and everyone in the group agreed that they believe the Bible is true and want to be baptized together. The whole group will meet next week and get baptized in the ocean.', 0, 'trash', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1004),
  (10179, 10084, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-07-02 15:34:43', '2018-07-02 15:34:43', 'Met with Safiyah and she said Safir\'s parents came and everyone in the group agreed that they believe the Bible is true and want to be baptized together. The whole group will meet next week and get baptized in the ocean.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1004),
  (10180, 10088, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-07-02 15:35:58', '2018-07-02 15:35:58', 'friend of the Jouiti family and mother of Safir.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1004),
  (10181, 10089, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-07-02 15:37:09', '2018-07-02 15:37:09', 'Friend of the Jouiti family, father of Safir and wife of Sara', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1004),
  (10182, 10043, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-02 16:07:55', '2018-07-02 16:07:55', 'Called again, he didn\'t want to talk much but said he would like a Bible. I will call him when I am heading over there anyway see if he\'s able to meet.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.87 Safari/537.36', 'comment', 0, 1011),
  (10183, 10043, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-02 16:10:30', '2018-07-02 16:10:30', 'I met with Mourad today very briefly. He is in his mid forties. He didn\'t want to sit and chat, but left right after I gave him the Bible. I will call him next time I\'m in town.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.87 Safari/537.36', 'comment', 0, 1011),
  (10184, 10043, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-02 16:11:19', '2018-07-02 16:11:19', 'I called him today but he wasn\'t interested. I will put him on pause.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.87 Safari/537.36', 'comment', 0, 1011),
  (10185, 10047, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-02 16:16:17', '2018-07-02 16:16:17', 'I met Tarik while he is in Madrid for business. He seems sharp. He had a lot of questions, but I tried to direct him to the Bible (I gave him a New Testament) , starting in Matthew. We read through Matthew 1-4 - and encouraged him to continue reading until the next time we met.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.87 Safari/537.36', 'comment', 0, 1011),
  (10186, 10047, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-02 16:18:45', '2018-07-02 16:18:45', 'Tarik has called me several times since we met during his business trip to Madrid. He says he can\'t wait to meet me again. He has read all of Matthew, but still wants a lot of clarification on things in there. I encouraged him to read through Matthew slowly, and to ask God to show him the Truth, and to help him understand what he is reading. Praise God he is still eager!', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.87 Safari/537.36', 'comment', 0, 1011),
  (10187, 10051, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-02 16:19:46', '2018-07-02 16:19:46', 'Called and agreed to meet downtown, but he was a no show. I tried calling his phone but there was no answer.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.87 Safari/537.36', 'comment', 0, 1011),
  (10188, 10051, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-02 16:20:58', '2018-07-02 16:20:58', 'He called me and apologized for missing me. I didn\'t catch his reason. I asked if he could come meet me in Madrid, he said yes', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.87 Safari/537.36', 'comment', 0, 1011),
  (10189, 10051, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-02 16:29:29', '2018-07-02 16:29:29', 'I went to meet with Youssouf yesterday, and he had brought 2 friends with him! A girl Amal and a guy Juan - they both seemed almost more interested than him. I asked what they were wanting to find out, and Amal said \"Truth!\" - Interesting!\nWe talked about needing to find truth, they seemed curious when I took out my Bible. We read through Matthew 1-3, but with a lot of interruptions. Amal asked if she could have a Bible. I said she could have that one. I encouraged them to meet and read it and discuss it together. Though he says he\'s an atheist, Youssouf didn\'t flinch when reading those chapters. They would have stayed longer than the two hours I had, but I said we could meet again, but again, they should meet on their own.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.87 Safari/537.36', 'comment', 0, 1011),
  (10190, 10081, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '162.243.29.229', '2018-07-03 09:12:33', '2018-07-03 09:12:33', 'Have one ready and will mail one in the morning.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 'comment', 0, 1006),
  (10191, 10081, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '162.243.29.229', '2018-07-03 09:15:01', '2018-07-03 09:15:01', 'Mailed one. Assigning back to marketer @[David Smith](8) - if we hear anything more than we can assign to a multiplier.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 'comment', 0, 1006),
  (10192, 10062, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '162.243.29.229', '2018-07-03 09:15:51', '2018-07-03 09:15:51', 'Will mail one this afternoon.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 'comment', 0, 1006),
  (10193, 10062, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '162.243.29.229', '2018-07-03 09:17:17', '2018-07-03 09:17:17', 'Assigning back to you @[Rachel Black (dispatcher)](7)', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 'comment', 0, 1006),
  (10194, 10037, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '162.243.29.229', '2018-07-03 09:29:21', '2018-07-03 09:29:21', '@[Christopher Berganza (multiplier)](11) This guy has been \"update needed\" for almost a month. Are you able to contact him this week?', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 'comment', 0, 1006),
  (10195, 10037, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-03 09:46:32', '2018-07-03 09:46:32', 'Yes, I will call him today', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 'comment', 0, 1011),
  (10196, 10037, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-03 09:47:44', '2018-07-03 09:47:44', 'A woman answered, said this was her phone, not someone called Zeyn. Wrong number.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 'comment', 0, 1011),
  (10197, 10039, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-03 09:53:10', '2018-07-03 09:53:10', 'Called Abdelkader today, he says he is a Christian, he has a NT and has been reading it. I am unable to travel to Morocco at the moment, but we promised to keep in touch by phone. I encouraged him to talk with his family and friends about what he believes, and to get them to read the Bible with him. We talked about making a list of family and friends and praying for them. Will call again soon and see if he has implemented anything.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 'comment', 0, 1011),
  (10198, 10093, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-03 09:58:25', '2018-07-03 09:58:25', 'Youssouf\'s friend that is reading with him and Juan.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 'comment', 0, 1011),
  (10199, 10093, 'Duplicate Checker', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-03 09:58:25', '2018-07-03 09:58:25', 'Possible duplicates on Name:\n                - [Youssouf, Amal, Juan](https://nightly.disciple.tools/groups/92/)\n', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 'duplicate', 0, 1000),
  (10200, 10093, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-03 09:59:29', '2018-07-03 09:59:29', 'See notes on our meetings with Youssouf (Pre-Group)', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 'comment', 0, 1011),
  (10201, 10094, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-03 10:00:22', '2018-07-03 10:00:22', 'Juan came to the meeting with Youssouf - see his notes.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 'comment', 0, 1011);
INSERT INTO `dt14330_comments` (`comment_ID`, `comment_post_ID`, `comment_author`, `comment_author_email`, `comment_author_url`, `comment_author_IP`, `comment_date`, `comment_date_gmt`, `comment_content`, `comment_karma`, `comment_approved`, `comment_agent`, `comment_type`, `comment_parent`, `user_id`) VALUES
  (10202, 10094, 'Duplicate Checker', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-03 10:00:22', '2018-07-03 10:00:22', 'Possible duplicates on Name:\n                - [Youssouf, Amal, Juan](https://nightly.disciple.tools/groups/92/)\n', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 'duplicate', 0, 1000),
  (10203, 10094, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-03 10:01:58', '2018-07-03 10:01:58', 'His real name is Ali, but he prefers Juan. In group with Youssouf and Amal - see Youssouf\'s notes.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 'comment', 0, 1011),
  (10204, 10051, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-03 10:17:02', '2018-07-03 10:17:02', 'I was meeting with someone else in Castilla Y Leon today, so I called Youssouf to see if he would be free. All three of them came again!\nThey had read through Matthew 4-10 already, but I went through it again slower. I had given my Bible to Amal last time, so Youssouf had went out and bought one in Spanish. He would prefer one in Arabic though, so I said I\'d bring one next time. They seem to bounce off of each other well, though Amal seems to be the most keen. They asked questions about Church, and about how to pray, so we re-read Matthew 6. They have a lot of questions but are happy to read the chapters to find the answers, so I\'m hopeful for this group. May God bless them to grow fruitfully.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 'comment', 0, 1011),
  (10205, 10040, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-03 10:32:08', '2018-07-03 10:32:08', 'I called him today to confirm that we were meeting but he didn\'t answer. Then his phone was off for the rest of the day.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 'comment', 0, 1011),
  (10206, 10040, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-03 10:32:44', '2018-07-03 10:32:44', 'I called him today, to ask about the meeting he missed yesterday - still no answer.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 'comment', 0, 1011),
  (10207, 10040, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-03 10:33:32', '2018-07-03 10:33:32', 'I called today and he answered, saying his phone stopped working. I suggested we could meet next week, and he gave an excuse. He doesn\'t seem as interested anymore.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 'comment', 0, 1011),
  (10208, 10040, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-03 10:34:04', '2018-07-03 10:34:04', 'I left it a few days then texted Abdellatif. Haven\'t heard back.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 'comment', 0, 1011),
  (10209, 10040, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-03 10:35:24', '2018-07-03 10:35:24', 'I called him today, but he said he\'s not interested. Closed.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 'comment', 0, 1011),
  (10210, 10047, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-03 10:47:18', '2018-07-03 10:47:18', 'Tarik called me today, saying he dreamed about Jesus! He came to him and said to follow me! I will show you the way to God. Tarik is convinced he wants to become a Christian. I read to him from John 14 and he said \"yes! that\'s what He said! What do I have to do to follow him?\" We spent more than an hour on the phone, but he was patient with me. I had him read parts of Matthew and Acts, making sure he understood the cost of following Jesus, and  that there would be persecution. He wants me to visit him.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 'comment', 0, 1011),
  (10211, 10047, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-03 10:49:11', '2018-07-03 10:49:11', 'We met up by the coast. He had been reading about baptism - we reread the passages and I had him tell me his understanding of who Jesus is and what following him means. Praise Father, he was baptized! Looking forward to meeting with him again.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 'comment', 0, 1011),
  (10212, 10047, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-03 10:49:49', '2018-07-03 10:49:49', 'Oh, and he had been sharing with his brother and some friends at work. Praying for this guy.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 'comment', 0, 1011),
  (10213, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-03 10:51:10', '2018-07-03 10:51:10', 'Haven\'t updated in a couple of months! Wasim and I meet regularly. He is still meeting with Ismail, and says he is ready to be baptized soon.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 'comment', 0, 1011),
  (10214, 10038, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '162.243.29.229', '2018-07-03 10:52:53', '2018-07-03 10:52:53', 'Have forgotten to update in a couple of months! Wasim has been meeting with Ismail regularly, without me. Today we went to the coast and Wasim baptized him! Hoping that these two start a group...', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 'comment', 0, 1011),
  (10215, 10063, 'Isabel Arboleda (multiplier)', 'multiplier1@disciple.tools', '', '162.243.29.229', '2018-07-03 10:56:06', '2018-07-03 10:56:06', 'I have been gone for the summer! I will contact her today.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 'comment', 0, 1009),
  (10216, 10045, 'Isabel Arboleda (multiplier)', 'multiplier1@disciple.tools', '', '162.243.29.229', '2018-07-03 11:00:12', '2018-07-03 11:00:12', 'We met up after her exams before I left for the summer. When she saw that I had the Bible on my phone, she said she would prefer that as her parents might not like her searching. She seemed eager but didn\'t want to stay long. Hopefully will meet up again when I\'m back.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 'comment', 0, 1009),
  (10217, 10063, 'Isabel Arboleda (multiplier)', 'multiplier1@disciple.tools', '', '162.243.29.229', '2018-07-03 11:21:10', '2018-07-03 11:21:10', 'Called, no answer, twice.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 'comment', 0, 1009),
  (10218, 10042, 'Isabel Arboleda (multiplier)', 'multiplier1@disciple.tools', '', '162.243.29.229', '2018-07-03 11:22:07', '2018-07-03 11:22:07', 'Try to meet tomorrow. She was brief on the phone.', 0, 'post-trashed', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 'comment', 0, 1009),
  (10219, 10095, 'Damián Abellán (Dispatcher)', 'dispatcher1@disciple.tools', '', '162.243.29.229', '2018-07-03 11:31:29', '2018-07-03 11:31:29', 'This contact selected \"I want to know more about Jesus and the Bible\" on the webform.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 'comment', 0, 1006),
  (10220, 10084, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-07-03 11:34:44', '2018-07-03 11:34:44', 'Ahmad shared with both his brothers. One was very resistant and angry while the other was very interested and wants to join their group and start reading with them.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1004),
  (10221, 10097, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-07-03 11:35:52', '2018-07-03 11:35:52', 'Brother of Ahmad Jouiti', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1004),
  (10222, 10098, 'Mary Smith (marketer)', 'marketer1@disciple.tools', '', '162.243.29.229', '2018-07-03 11:37:02', '2018-07-03 11:37:02', 'This contact selected \"I want to become a Christian, but there are obstacles\" on the webform.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64; rv:57.0) Gecko/20100101 Firefox/57.0', 'comment', 0, 1005),
  (10223, 10084, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-07-03 11:37:27', '2018-07-03 11:37:27', 'Safir and Ben are going to Barcelona for university and hope to start a group there. They will continue to meet and ask others living in their dorms to join them.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1004),
  (10224, 10099, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-07-03 11:39:55', '2018-07-03 11:39:55', 'Safir shared his faith with his roommate and his roommate who is from the USA was super impressed and really wants to study with Ben and Safir.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1004),
  (10225, 10100, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-07-03 11:41:04', '2018-07-03 11:41:04', 'Safir\'s roommate he met in university at Barcelona. He is American and wants to study the Bible with Safir and Ben. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1004),
  (10226, 10100, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-07-03 11:44:18', '2018-07-03 11:44:18', 'Update: Safir\'s roommate Brian grew up in New Hampshire and didn\'t know a lot of Christians growing up and had a really bad taste for the religion but Safir said that he was really impressed by Safir\'s passion and kindness and Brian and him having been talking about the Bible every night for the last week. Brian has a Spanish girlfriend that he wants to start bringing to their study. Safir encouraged Brian to ask her to bring other girls to to make the group more dynamic.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1004),
  (10227, 10099, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-07-03 11:44:53', '2018-07-03 11:44:53', 'Update: Safir\'s roommate Brian grew up in New Hampshire and didn\'t know a lot of Christians growing up and had a really bad taste for the religion but Safir said that he was really impressed by Safir\'s passion and kindness and Brian and him having been talking about the Bible every night for the last week. Brian has a Spanish girlfriend that he wants to start bringing to their study. Safir encouraged Brian to ask her to bring other girls to to make the group more dynamic.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1004),
  (10228, 10101, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-07-03 11:46:12', '2018-07-03 11:46:12', 'girl friend of the American Brian White who is roommates with Safir', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1004),
  (10229, 10102, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-07-03 11:49:11', '2018-07-03 11:49:11', 'friend of Maria Castillo who is the girl friend of Brian White who is the roommate of Safir. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1004),
  (10230, 10099, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '162.243.29.229', '2018-07-03 11:52:36', '2018-07-03 11:52:36', 'Update: Wow! God has really blessed Safir with finding low hanging fruit so early in the year. This group has been hanging out a lot together and it seems to be very centralized around spiritual topics. Brian and the girls have tons of questions and said they weren\'t expecting to learn so much about Jesus through Arabs but it has given them a totally different perspective. Safir said that Brian has been struggling with sin (he didn\'t mention exactly what which is good) and he is helping to keep him accountable. All three of them have mentioned wanting to get baptized and keep growing there group.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.1 Safari/605.1.15', 'comment', 0, 1004),
  (10231, 10103, 'David Smith (Marketer)', 'marketer2@disciple.tools', '', '162.243.29.229', '2018-07-17 14:40:28', '2018-07-17 14:40:28', 'This guy wants a Bible and to meet with a Christian face-to-face', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.2 Safari/605.1.15', 'comment', 0, 1008),
  (10232, 10103, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '162.243.29.229', '2018-07-17 14:43:33', '2018-07-17 14:43:33', '@[Anthony Palacio (multiplier)](10) This seems like an interested guy. Can you give him a call and try to meet up with him?', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.2 Safari/605.1.15', 'comment', 0, 1007),
  (10233, 10104, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '162.243.29.229', '2018-07-17 14:50:27', '2018-07-17 14:50:27', 'She sent us a private message and really want to receive a Bible and meet with someone face-to-face.', 0, 'post-trashed', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.2 Safari/605.1.15', 'comment', 0, 1007),
  (10234, 10104, 'Duplicate Checker', 'dispatcher2@disciple.tools', '', '162.243.29.229', '2018-07-17 14:50:27', '2018-07-17 14:50:27', 'Possible duplicates on Name:\n                - [Jane Doe (multiplier)](https://nightly.disciple.tools/contacts/6/)\n', 0, 'post-trashed', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.2 Safari/605.1.15', 'duplicate', 0, 1000),
  (10235, 10105, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '162.243.29.229', '2018-07-17 14:54:35', '2018-07-17 14:54:35', 'She messaged us privately on the Facebook page. She wants a Bible and to meet someone face-to-face.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.2 Safari/605.1.15', 'comment', 0, 1007),
  (10236, 10105, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '162.243.29.229', '2018-07-17 14:56:07', '2018-07-17 14:56:07', '@[Isabel Arboleda (multiplier)](9) Can you give this girl a call? Thanks!', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.2 Safari/605.1.15', 'comment', 0, 1007),
  (10237, 10049, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '162.243.29.229', '2018-07-17 14:59:41', '2018-07-17 14:59:41', '@[Jane Doe (multiplier)](4) We haven\'t heard about this contact recently. Do you have an update?', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.2 Safari/605.1.15', 'comment', 0, 1007),
  (10238, 10103, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-07-17 15:55:26', '2018-07-17 15:55:26', 'We will meet tomorrow at 12:00 pm at the Main St. Cafe', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.2 Safari/605.1.15', 'comment', 0, 1010),
  (10239, 10103, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-07-17 15:56:11', '2018-07-17 15:56:11', 'Gave Him the Bible and we read from Matthew 1-5 together. He was very interested and is excited to meet again once we has finished reading Matthew', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.2 Safari/605.1.15', 'comment', 0, 1010),
  (10240, 10041, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '162.243.29.229', '2018-07-17 16:02:26', '2018-07-17 16:02:26', 'We met a couple of weeks ago. Sorry I didn\'t update this contact. He wasn\'t very interested after meeting. He only stayed for about 15 minutes and had to leave.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.2 Safari/605.1.15', 'comment', 0, 1010);
